// App.js
import React, { useEffect, useState } from "react";

const App = () => {
  const [resourceData, setResourceData] = useState(null);

  useEffect(() => {
    // Replace 'your-jwt-token' with the actual JWT token you have
    const jwtToken = 
"eyJhbGciOiJSUzI1NiIsInR5cCIgOiAiSldUIiwia2lkIiA6ICJ6R0RyQzRKcWptcWU1YTAxUEtBZXBNaURYMVZBMWl2TDRnWmg3b2l3QlhnIn0..bJPNDpAme3rBzGbbo3tvxesVZdw87tSEEdnVTjft2yOxedffhvDX8iJ66aF6F9FSx0ULcVdA85Kl_pogm2VXxZApwp5_8yWRlGh3Q5aGX3qfnvRFd0vLV_JIQ4qN_xX95xZ_IB_Co7Md4Zwm2Y7LvOACAgPrtl-Na_gS1q1xPhARy6RlfRhA6e4jBznH8kNkyAR3WasdG9UKfwjCBUVOijLiCtfaQW5ad5a5JfY3JlC_fjReGGXfLvUud-vAcit5A49S8Oq2Zq0NjiznWQ-RDMTxxQ64QRjNYpPtJGcxry63dVaznq5hTpffjuGBTK2ni89EOSX3NAVu4vOOaZjQDQ";
    // URL of your Go service's protected resource
    const url = "http://localhost:8000/api/resource";

    // Make the API request with the JWT token in the Authorization header
    fetch(url, {
      method: "GET",
      headers: {
        Authorization: `Bearer ${jwtToken}`,
      },
      mode: "no-cors", // Set the mode to 'no-cors'
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        // Response data won't be accessible due to 'no-cors' mode
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []);

  return (
    <div>
      <h1>Hello, world!</h1>
      <p>Resource Data: {resourceData}</p>
    </div>
  );
};

export default App;
